import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>
            <div className='principal'>

            </div>
            <style jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    width: 100%;
                    height: 100%;
                    margin:0; padding:0;
                }  
                .principal{
                    color: blue;
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
